import './App.css';
import Home from './components/home/home';
import About from './components/about/about';
function App() {
  return (
    <div>
    <div class="row">
        <div class="col-xs-offset-2 col-xs-8">
            <div class="page-header"><h2>React Router Demo</h2></div>
        </div>
    </div>
    <div class="row">
        <div class="col-xs-2 col-xs-offset-2">
            <div class="list-group">
                {/* 设置路由链接 */}
                <Link class="list-group-item active" to="./components/about">About</Link>
                <Link class="list-group-item" to="./home.html">Home</Link>
            </div>
        </div>
        <div class="col-xs-6">
            <div class="panel">
                <div class="panel-body">
                    <h3>我是About的内容</h3>
                </div>
            </div>
        </div>
    </div>
</div>
  );
}

export default App;
